  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `table_id` int(11) DEFAULT NULL COMMENT '归属表编号',
  `name` varchar(200) DEFAULT NULL COMMENT '名称',
  `comment` varchar(500) DEFAULT NULL COMMENT '描述',
  `jdbc_type` varchar(100) DEFAULT NULL COMMENT '列的数据类型的字节长度',
  `java_type` varchar(500) DEFAULT NULL COMMENT 'JAVA类型',
  `java_field` varchar(200) DEFAULT NULL COMMENT 'JAVA字段名',
  `is_insert` char(1) DEFAULT '1' COMMENT '是否为插入字段',
  `is_edit` char(1) DEFAULT '1' COMMENT '是否编辑字段',
  `is_list` char(1) DEFAULT '1' COMMENT '是否列表字段',
  `is_query` char(1) DEFAULT '1' COMMENT '是否查询字段',
  `excel_in` char(1) DEFAULT '1' COMMENT '导入',
  `excel_out` char(1) DEFAULT '1' COMMENT '导出',
  `grid` varchar(20) DEFAULT '1' COMMENT '新行',
  `query_type` varchar(200) DEFAULT NULL COMMENT '查询方式（等于、不等于、大于、小于、范围、左LIKE、右LIKE、左右LIKE）',
  `show_type` varchar(200) DEFAULT NULL COMMENT '字段生成方案（文本框、文本域、下拉框、复选框、单选框、字典选择、人员选择、部门选择、区域选择）',
  `dic_type` varchar(200) DEFAULT NULL COMMENT '字典类型',
  `data_table` varchar(200) DEFAULT NULL COMMENT '绑定数据表',
  `validate` varchar(200) DEFAULT NULL COMMENT '验证规则',
  `settings` varchar(2000) DEFAULT NULL COMMENT '其它设置（扩展字段JSON）',
  `sort` int(11) DEFAULT NULL COMMENT '排序（升序）',
  `inserter` int(11) DEFAULT NULL COMMENT '创建者',
  `insert_time` datetime DEFAULT NULL COMMENT '创建时间',
  `updater` int(11) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `gen_table_column_table_id` (`table_id`) USING BTREE,
  KEY `gen_table_column_name` (`name`) USING BTREE,
  KEY `gen_table_column_sort` (`sort`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6363 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='业务表字段';

