-- Table structure for oauth_client_details
-- ----------------------------
DROP TABLE IF EXISTS `oauth_client_details`;
CREATE TABLE `oauth_client_details` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `client_id` varchar(50) DEFAULT NULL COMMENT '客户端id',
  `client_secret` varchar(100) DEFAULT NULL,
  `client_name` varchar(100) DEFAULT NULL COMMENT '客户端名称',
  `client_uri` varchar(255) DEFAULT NULL COMMENT '客户端url',
  `client_icon_uri` varchar(255) DEFAULT NULL COMMENT '客户端图表连接',
  `resource_ids` varchar(255) DEFAULT NULL COMMENT '客户端所拥有的资源ID,多个ID时使用逗号(,)分隔',
  `scope` varchar(255) DEFAULT NULL COMMENT '客户端权限',
  `grant_types` varchar(255) DEFAULT NULL COMMENT '客户端所支持的授权模式(grant_type),至少一个, 多个值时使用逗号(,)分隔, 如: password,refresh_token',
  `redirect_uri` varchar(255) DEFAULT NULL COMMENT '客户端重定向url',
