-- ----------------------------
-- Procedure structure for gen_number
-- ----------------------------
DROP PROCEDURE IF EXISTS `gen_number`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `gen_number`(in idd int(11),out newNum varchar(50))
BEGIN
    DECLARE p_prefix varCHAR (50) ; -- 前缀 
    DECLARE p_suffix varCHAR (50) ; -- 后缀
    DECLARE p_dateformat varCHAR (15) ; -- 日期格式
    DECLARE p_numlength int ; -- 流水号长度 
 		DECLARE p_currentDate varCHAR (15) ; -- 当前日期,有可能包含时分秒
		DECLARE p_maxNum INT DEFAULT 0 ; -- 离现在最近的满足条件的订单编号的流水号最后numlength位
		DECLARE p_oldNum int DEFAULT 0 ; -- 离现在最近的满足条件的订单编号
    SELECT prefix,suffix,date_format,num_length INTO p_prefix,p_suffix,p_dateformat,p_numlength from sys_number where id = idd for update;-- 变量赋值
		if p_dateformat != '' then -- 根据年月日生成订单编号
		  SELECT DATE_FORMAT(NOW(), p_dateformat) INTO p_currentDate ; -- 订单编号形式：前缀+年月日时分秒+流水号+后缀
		  SELECT num INTO p_oldNum from sys_number where id = idd and DATE_FORMAT(insert_time,p_dateformat) = p_currentDate;
		else -- 没有前缀
		  SELECT '' INTO p_currentDate ;
		  SELECT IFNULL(num,0) INTO p_oldNum from sys_number where id = idd;
		end if ;
		SELECT CONCAT(p_prefix, p_currentDate,  LPAD((p_oldNum+1), p_numlength, '0'),p_suffix) INTO newNum ; -- LPAD((oldNum + 1), 5, '0')：如果不足5位，将用0填充左边
		UPDATE sys_number set num =  (p_oldNum+1)  where id = idd;
    SELECT  newNum;
	COMMIT;
	END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for organization_hasChild
-- ----------------------------
DROP FUNCTION IF EXISTS `organization_hasChild`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `organization_hasChild`(id INT) RETURNS varchar(10) CHARSET utf8
BEGIN
#定义返回参数 
	 DECLARE state varchar(10);
   DECLARE child int(10); 
   SET child = (SELECT  count(*)  FROM sys_organization WHERE pid=id);
   IF(child>0) THEN  
    SET state='true';  
   ELSE 
	  SET state='false';
   END IF;
	 RETURN state;
END
;;
DELIMITER ;

